import React,{ Component} from 'react';
import './App.css';
import Search from './Search.jsx';
import Movie from './Movie.jsx';

class App extends Component{
  constructor(props){
    super(props);
    this.state={
      searchText:""
    }
  }

  textOnChange(value){
    this.setState({searchText: value});
  }

  render(){
    return (
      <div className="App">
        <Search/>
        <Movie/>
      </div>
    );
  }

}

export default App;
